pane nodes are the basic building blocks of a layout. They could represent standalone panes: layout { pane // panes can be bare pane command="htop" // panes can have arguments on the same line pane { // panes can have arguments inside child-braces command "exa" cwd "/" } pane command="ls" { // or a mixture of same-line and child-braces arguments cwd "/" }
} They could also represent logical containers: layout { pane split_direction="vertical" { pane pane }
} Note : if panes represent logical containers, all their arguments should be specified on their title line. split_direction split_direction is a pane argument that indicates whether its children will be laid out vertically or horizontally. Possible values: "vertical" | "horizontal" Default value if omitted: "horizontal" eg. layout { pane split_direction="vertical" { pane pane } pane { // value omitted, will be layed out horizontally pane pane }
} Note : The layout node itself has a set value of "horizontal". It can be changed by adding a logical pane container: layout { pane split_direction="vertical" { pane pane }
} size size is a pane argument that represents the fixed or percentage space taken up by this pane inside its logical container. Possible values: quoted percentages (eg. "50%") | fixed values (eg. 1) Note : specifying fixed values that are not unselectable plugins is currently unstable and might lead to unexpected behaviour when resizing or closing panes. Please see this issue . eg. layout { pane size=5 pane split_direction="vertical" { pane size="80%" pane size="20%" } pane size=4
} borderless borderless is a pane argument indicating whether a pane should have a frame or not. Possible values: true | false Default value if omitted: false eg. layout { pane borderless=true pane { borderless true }
} focus focus is a pane argument indicating whether a pane should have focus on startup. Possible values: true | false Default value if omitted: false Note : specifying multiple panes with focus will result in the first one of them being focused. eg. layout { pane focus=true pane { focus true }
} name name is a string pane argument to change the default pane title. Possible values: "a quoted string" eg. layout { pane name="my awesome pane" pane { name "my amazing pane" }
} cwd A pane can have a cwd argument, pointing to its Current Working Directory. Possible values: "/path/to/some/folder", "relative/path/to/some/folder" Note : If the cwd is a relative path, it will be appended to its containers' cwd read more about cwd composition eg. layout { pane cwd="/" pane { command "git" args "diff" cwd "/path/to/some/folder" }
} command command is a string (path) to an executable that should be run in this pane instead of the default shell. Possible values: "/path/to/some/executable" | "executable" (the latter should be accessible through PATH) eg. layout { pane command="htop" pane { command "/usr/bin/btm" }
} args A pane with a command can also have an args argument. This argument can include one or more strings that will be passed to the command as its arguments. Possible values: "a" "series" "of" "quoted" "strings" Note : args must be inside the pane's child-braces and cannot be specified on the same line as the pane. eg. layout { pane command="tail" { args "-f" "/path/to/my/logfile" } // Hint: include "quoted" shell arguments as a single argument: pane command="bash" { args "-c" "tail -f /path/to/my/logfile" } } close_on_exit A pane with a command can also have a close_on_exit argument. If true, this pane will close immediately when its command exits - instead of the default behaviour which is to give the user a chance to re-run it with ENTER and see its exit status Possible values: true | false eg. layout { pane command="htop" close_on_exit=true
} start_suspended A pane with a command can also have a start_suspended argument. If true, this pane will not immediately run the command on startup, but rather display a message inviting the user to press <ENTER> to first run the command. It will then behave normally. This can be useful when starting a layout with lots of commands and not wanting all of them to immediately run. Possible values: true | false eg. layout { pane command="ls" start_suspended=true
} edit edit is a string (path) to a file that will be opened using the editor specified in the EDITOR or VISUAL environment variables. This can alternatively also be specified using the scrollback_editor config variable. Possible values: "/path/to/some/file" | "./relative/path/from/cwd" Note : If the value is a relative path, it will be appended to its containers' cwd read more about cwd composition eg. layout { pane split_direction="vertical" { pane edit="./git_diff_side_a" pane edit="./git_diff_side_b" }
} plugin plugin is a pane argument the points to a Zellij plugin to load. Currently is is only possible to specify inside the child-braces of a pane followed by a URL location in quoted string. Possible values: zellij:internal-plugin | file:/path/to/my/plugin.wasm eg. layout { pane { plugin location="zellij:status-bar" }
} stacked If true, this pane property dictates that the children panes of this pane will be arranged in a stack. In a stack of panes, all panes except one have just one line - showing their title (and their scroll and exit code when relevant). The focused pane among these is displayed normally as any other pane. eg. layout { pane stacked=true { pane pane pane command="ls" pane command="htop" pane edit="src/main.rs" }
} expanded In the context of stacked panes, an expanded child will dictate that this pane in the stack should be the one expanded, rather than the lowest pane (the default). eg. layout { pane stacked=true { pane pane expanded=true pane pane }
}

