tab nodes can optionally be used to start a layout with several tabs. Note : all tab arguments should be specified on its title line. The child-braces are reserved for its child panes. eg. layout { tab // a tab with a single pane tab { // a tab with three horizontal panes pane pane pane } tab name="my third tab" split_direction="vertical" { // a tab with a name and two vertical panes pane pane }
} split_direction Tabs can have a split_direction just like panes. This argument indicates whether the tab's children will be laid out vertically or horizontally. Possible values: "vertical" | "horizontal" Default value if omitted: "horizontal" eg. layout { tab split_direction="vertical" { pane pane } tab { // if omitted, will be "horizontal" by default pane pane }
} focus Tabs can have a focus just like panes. This argument indicates whether a tab should have focus on startup. Possible values: true | false Default value if omitted: false Note : only one tab can be focused. eg. layout { tab { pane pane } tab focus=true { pane pane }
} name Tabs can have a name just like panes. This argument is a string to change the default tab title. Possible values: "a quoted string" eg. layout { tab name="my awesome tab" tab name="my amazing tab" { pane }
} cwd Tabs can have a cwd just like panes - pointing to their Current Working Directory. All panes in this tab will have this cwd prefixed to their own cwd (if they have one) or start in this cwd if they don't. Possible values: "/path/to/some/folder", "relative/path/to/some/folder" Note : If the cwd is a relative path, it will be appended to its containers' cwd read more about cwd composition eg. layout { tab name="my amazing tab" cwd="/tmp" { pane // will have its cwd set to "/tmp" pane cwd="foo" // will have its cwd set to "/tmp/foo" pane cwd="/home/foo" // will have its cwd set to "/home/foo", overriding the tab cwd with its absolute path }
} hide_floating_panes If set, all floating panes defined in this tab will be hidden on startup. eg. tab name="Tab #1" hide_floating_panes=true { pane pane floating_panes { // will start hidden pane pane }
}

