Templates can be used avoid repetition when creating layouts. Each template has a name that should be used directly as a node name instead of "pane" or "tab". Pane Templates Pane templates can be used to shorten pane attributes: layout { pane_template name="htop" { command "htop" } pane_template name="htop-tree" { command "htop" args "--tree" borderless true } // the below will create a template with four panes // the top and bottom panes running htop and the two // middle panes running "htop --tree" without a pane frame htop htop-tree htop-tree htop
} Pane templates with the command attribute can take the args and cwd of their consumers: layout { pane_template name="follow-log" command="tail" follow-log { args "-f" "/tmp/my-first-log" } follow-log { args "-f" "my-second-log" cwd "/tmp" }
} Note : the above only works for direct consumers and not other templates. Pane templates can be used as logical containers. In this case a special children node must be specified to indicate where the child panes should be inserted. Note : the children node can be nested inside panes but not inside other pane_templates. layout { pane_template name="vertical-sandwich" split_direction="vertical" { pane children pane } vertical-sandwich { pane command="htop" }
} Pane templates can include other pane templates. layout { pane_template name="vertical-sandwich" split_direction="vertical" { pane children pane } pane_template name="vertical-htop-sandwich" { vertical-sandwich { pane command="htop" } } pane_template name="vertical-htop-sandwich-below" split_direction="horizontal" { children vertical-htop-sandwich } vertical-htop-sandwich vertical-htop-sandwich-below { pane command="exa" }
} The children node should be thought of as a placeholder for the pane using this template. This: layout { pane_template name="my_template" { pane children pane } my_template split_direction="vertical" { pane pane }
} Will be translated into this: layout { pane { pane pane split_direction="vertical" { pane pane } pane }
} Tab Templates Tab templates, similar to pane templates, help avoiding repetition when defining tabs. Like pane_templates they can include a children block to indicate where their child panes should be inserted. Note : for the sake of clarity, arguments passed to tab_templates can only be specified on their title line. layout { tab_template name="ranger-on-the-side" { pane size=1 borderless=true { plugin location="zellij:compact-bar" } pane split_direction="vertical" { pane command="ranger" size="20%" children } } ranger-on-the-side name="my first tab" split_direction="horizontal" { pane pane } ranger-on-the-side name="my second tab" split_direction="vertical" { pane pane }
} Default Tab Template There is a special default_tab_template node that can be used just like a regular tab_template node, but that would apply to all tabs in the template as well as all new tabs opened in the session. Note : the default_tab_template will not apply to tabs using other tab_templates. Another note : if no tabs are specified, the whole layout is treated as a default_tab_template. layout { default_tab_template { // the default zellij tab-bar and status bar plugins pane size=1 borderless=true { plugin location="zellij:tab-bar" } children pane size=2 borderless=true { plugin location="zellij:status-bar" } } tab // the default_tab_template tab name="second tab" // the default_tab_template with a custom tab name tab split_direction="vertical" { // the default_tab_template with three vertical panes between the plugins pane pane pane }
}

