When configured, keybindings override the default keybinds of the application individually (if a certain key was bound in the configuration, it overrides that key in the default configuration). It's possible to explicitly unbind a key: keybinds { unbind "Ctrl g" // unbind in all modes normal { unbind "Alt h" "Alt n" // unbind one or more keys in a specific mode }
} It's also possible to use the special clear-defaults=true attribute either globally or in a specific mode: keybinds clear-defaults=true { // will clear all default keybinds normal { // ... }
} keybinds { normal clear-defaults=true { // will clear all keybinds in normal mode // ... }
}
